import React from 'react';

const PaymentCOD = () => {
    return (
        <div>
            <h3 className="text-lg font-bold mb-2">Thanh toán khi nhận hàng (COD)</h3>
            <p>Phương thức thanh toán này sẽ thu tiền mặt khi đơn hàng của bạn được giao tới.</p>
        </div>
    );
};

export default PaymentCOD;
